window.bookSummaryJSON = "<p>Grave witch Alex Craft is getting pulled back into deadly fae politics in the thrilling new novel in the <i>USA Today</i> best-selling series.</p> <p>Grave witch Alex Craft has forged an uneasy truce with the world of Faerie, but she's still been trying to maintain at least some semblance of a normal life in the human world. So it's safe to say that stepping up as the lead investigator for the Fae Investigation Bureau was not a career path she ever anticipated taking.</p> <p>When an explosion at the Eternal Bloom threatens to upend the fae who make their home in our world, Alex finds herself in charge of the most far-reaching investigation she's ever tackled. And it's only her first week on the job. With the threats mounting and cut off from half her allies, Alex can't wait on the sidelines and hope the fae's conflicts stay contained within their borders.</p> <p>Contains mature themes.</p>"; 
